import './AboutMe.css';
import TitleAboutMe from "./TitleAboutMe"


const AboutMe = () => {


let img = document.querySelector('#image-container');
img.src = '2023.jpeg';
img.alt = 'Описание изображения';
const container = 
container.append(img);

return ( <div className = "titleAbout">
    <TitleAboutMe />


<div className="head">
    <p className="text">
        You can look at my project here!

This is my big complex project I've done for Solita' Dev Academy Finland 2023! 
<br />
<br />It was very challenging to me because I am so excited to have an opportunity for becoming the member of Solita company. 
<br />
<br />City Bike App fetches stations from database and displays them in a list of stations items. Also this app fetches users from a database (using MongoDB), 
and, please, request for authorisation via ip from the author. The app features Routing(on the left side of the main menu), sort and pagination functionalities, and calculate statistics in Statistic table. Also you can add stations. 
<br />
<br />Through this, I used backend (Express.js, MongoDB, Node, Git) and frontend (React, material-ui, HTML, CSS, JavaScript). However, my prior experience on similar projects helped significantly.
    </p>

<img src="2023.jpeg"></img>
<img src="photo1.jpg"></img>


<div id="image-container"></div>


</div>



     </div>

)}

export default AboutMe;
